import {
  BlockContentFooter,
  ConatainerContentFooter,
  ContainerFooter,
} from "./style";
import LOGO from "../Logo/index";

function Index() {
  return (
    <>
      <ContainerFooter>
        <ConatainerContentFooter>
          <BlockContentFooter></BlockContentFooter>
          <BlockContentFooter>This firts</BlockContentFooter>
          <BlockContentFooter>This firts</BlockContentFooter>
          <BlockContentFooter>This firts</BlockContentFooter>
        </ConatainerContentFooter>
      </ContainerFooter>
    </>
  );
}

export default Index;
